import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter, BrowserRouter as Router} from 'react-router-dom';

ReactDOM.render(
    <BrowserRouter>
    <Router>
        <App />
    </Router>
    </BrowserRouter>
, document.getElementById('root'));
